import React from 'react'
import Navbar from '../layouts/Navbar'
import { MDBCard, MDBContainer, MDBListGroup, MDBListGroupItem, MDBNavbar, MDBNavbarBrand, MDBNavbarItem, MDBTable, MDBTableBody, MDBTypography } from 'mdb-react-ui-kit'

export function CheckoutNoAcc() {
    return (
        <div>
            <Navbar />

            <div>
                {stickyFooter()}
            </div>
        </div>
    )
}

export function CheckoutWithAcc() {
    return (
        <div>
            <Navbar></Navbar>
            <div>

                {stickyFooter()}
            </div>
        </div>
    )
}

function stickyFooter() {
    return (
        <div className='shadow-4-strong fixed-bottom '>
            <MDBTable>
                <MDBTableBody className="text-end">
                    <tr className='border-0'>
                        <td> Thành tiền</td>
                        <td>127.300 đ</td>
                    </tr>
                    <tr>
                        <td>Giảm giá (Nhập mã thành công - Mã giảm giá 10% - Đơn hàng từ 100K - Khi mua Sách Học Ngoại Ngữ)</td>
                        <td>-10.000 đ</td>
                    </tr>
                    <tr>
                        <td> Phí vận chuyển (Giao hàng tiêu chuẩn)</td>
                        <td>18.000 đ</td>
                    </tr>
                </MDBTableBody>
            </MDBTable>
        </div>
    )
}
